import {RouterProvider, createBrowserRouter, Outlet} from "react-router-dom";
import Layout from "./Layout.jsx";
import Welcome from"./components/Welcom.jsx";
import Owners from "./components/pages/owners/Owners.jsx";
import Create from "./components/pages/owners/components/Create.jsx";
import Info from "./components/pages/owners/components/Info.jsx";

import Verter from "./components/Veter.jsx";
import Result from "./components/Result.jsx";
import AddAnimal from "./components/AddPet.jsx";
import OwnerList from "./components/OwnerList.jsx";
import OwnerInfo from "./components/OwnerInfo.jsx";
import UpDatePet from "./components/UpDatePet.jsx";
import VisitPet from "./components/VisitPet.jsx";
import AddPet from "./components/AddPet.jsx";
import UpdateOwner from "./components/UpdateOwner.jsx";


function App() {
    const router = createBrowserRouter([
        {
            path:"/",
            element:<Welcome/>
        },
        {
            path:"/home",
            element:<Welcome/>
        },
        {
            path:"/owners",
            element:<Owners/>
        },
        {
            path:"/VETERINARIANS",
            element:<Verter/>
        },
        {
            path:"/owner/create",
            element:<Create />
        },
        {
            path:"/FindOwner",
            element:<OwnerInfo/>
        },
        {
            path:"/UpdateOwner",
            element:<UpdateOwner/>
        },
        {
            path:"/AddPet",
            element:<AddPet/>
        },
        {
            path:"/AddVisit",
            element:<VisitPet/>
        },
        {
            path:"/UpdatePet",
            element:<UpDatePet/>
        },
        {
            path:"/OwnerInfo",
            element:<OwnerInfo/>
        },
        {
            path:"/owner/:id",
            element:<Result/>
        },
    ])

    const router_ = createBrowserRouter([
        {
            path:"/",
            element: <Layout />,
            children: [
                { index: true, element: <Welcome /> },
                { path: "home", element: <Welcome /> },
                { path: "VETERINARIANS", element: <V /> },
                { path: "owners", element: <Owners /> },
                { path: "owners/create", element: <Create /> },
                { path: "owners/:id", element: <Info /> },

                // { path: "owners", element: <Owners /> },
                // { path: "owners", element: <Owners /> },
            ]
        }
    ])


    return (

    // <div className="App">
    //     <Navbar />
    //         <RouterProvider router={router}></RouterProvider>
    //     <Footer />
    // </div>

        <div className="App">
            <RouterProvider router={router_} />
        </div>
    );
}

export default App
